css:
@-moz-document domain("www.watchframebyframe.com") {
body {
 background: #121212;   
}

.well, .well-lg, .player-container, .container{
 display: block !important;   
}


.well{
    background-color: #000000;
    border: 1px solid #2f2f2f;   
}

.navbar-default {
    background-color: #212121;
    border-color: #000000;
}

.navbar-default .navbar-nav>li>a, .text-center {
    color: #dadada;
}

.btn-default:hover {
    color: #d6d6d6;
    background-color: #424242;
    /* border-color: #adadad; */
}

.btn-default {
    color: #c7c7c7;
    background-color: #000;
    border-color: #797979;
}

#step{
    color: #c7c7c7;
    background-color: #000;
    border-color: #797979;    
    width: 8em !important;
}

#speed{
    color: #fff;
    background-color: #000;
    border-color: #797979;     
	width: 5em !important;
}

#fps{
    color: #fff;
    background-color: #000;
    border-color: #797979;     
	width: 7em !important;    
}

.modal-header, .modal-body, .modal-footer{
 	background: #2f2f2f;
    color: white;   
}

#time, #frame, #url {
    background-color: black;
    border-color: #800000;
}

.thumbnail{
    display: none;
}
}
